import React from 'react';
import UserList from "./Components/UserList";
import AddUser from "./Components/AddUser";


function App() {

    const saveData = (inputData) => {
        const data = {
            userName: inputData.userName,
            age: inputData.age
        }
    }


  return (
    <div>
        <AddUser onSaveData={saveData(data)} />
        <UserList />
    </div>
  );
}

export default App;
